define('widgets/wemo_dimmer/js/edit',['Cache', 'hbs!widgets/wemo_dimmer/templates/edit','widgets/wemo_dimmer/js/model','widgets/wemo_dimmer/js/dimmerSetupChooseBulb','widgets/wemo_dimmer/js/hushMode'],
    /** @exports summary view */
        function(Backbone, template, Model, DimmerSetupChooseBulb, HushModeView) {
        'use strict';

        var View = Backbone.View.extend({
            template: template,
            initialize: function(options) {
                options = options || {};
                _.extend(this, options);
                if (!this.sandbox) {
                    throw ('you must pass the sandbox to this view.')
                } else {
                    this.model = this.sandbox.model;
                }
            },
            events: {
                "click .reConfigureBulbRow" : "loadDimmerSetupPage",
                "click .configHushModeRow" : "loadHushModePage"
            },
            bindings: {
                '*[data-bind="bulbType"]': {
                    observe: 'bulbType'
                },
                '*[data-bind="hushModeTime"]': {
                    observe: 'hushMode',
                    onGet: function(val) {
                        var hushMode = val.split(":"),
                            mode = parseInt(hushMode[0]),
                            str = "";

                        if (mode === 1) {
                            str = this.i18n("labels", "Until") +  this.convertToDay(parseInt(hushMode[1]) * 1000) + this.convertTime(parseInt(hushMode[1]) * 1000);
                        }

                        return str;
                    }
                }
            },
            /**
             * localizes the template, and inserts it into the document fragment. Also binds the DOM events
             */
            render: function() {
                var html = this.i18n(this.template);
                this.$el.html(html);
                var overTempStatus = this.model.get("overTemp"),
                    isOnRemote = (window.sessionStorage.getItem('isRemote') === "true");

                 if (parseInt(overTempStatus) === 1 || isOnRemote){
                    this.$el.hide();
                }
                this.stickit();
                this.delegateEvents();
            },
            loadDimmerSetupPage: function() {
                var self = this;
                this.sandbox.dimmerSetupChooseBulb = new DimmerSetupChooseBulb({
                    sandbox: self.sandbox,
                    parentElement: $(".wemo_edit_device"),
                    parent: self
                });
                this.sandbox.dimmerSetupChooseBulb.initialRender();
            },
            loadHushModePage: function() {
                var self = this;
                this.sandbox.hushModeView = new HushModeView({
                    sandbox: self.sandbox,
                    parentElement: $(".wemo_edit_device"),
                    parent: self
                });
                this.sandbox.hushModeView.initialRender();
            },
            /**
             * Function to convert seconds to HH:MM ampm
             * @param seconds
             * @returns {string}
             */
            convertTime: function(milliseconds) {
                var date = new Date(milliseconds),
                    hours = date.getHours(),
                    minutes = date.getMinutes();


                if (hours < 10) {
                    hours = hours;
                }
                if (minutes < 10) {
                    minutes = "0" + minutes;
                }

                var time = hours + ':' + minutes + ' am';

                if (hours === 0) {
                    time = '12:' + minutes + ' am';
                }

                if (hours >= 12) {
                    if (hours !== 12) {
                        hours = hours - 12;
                    }
                    time = hours + ':' + minutes + ' pm';
                }
                return time;
            },
            convertToDay: function(milliseconds) {
                var date = new Date(milliseconds),
                    day = date.getDay(),
                    daysArr = ['Sun','Mon','Tue','Wed','Thu','Fri','Sat'],
                    dayStr = "",
                    currentTime = new Date(),
                    oneDay =  24 * 60 * 60 * 1000 - 20000;

                if ((date-currentTime) > oneDay) {
                    dayStr = daysArr[day] + ", ";
                }
                return dayStr;
            }
         });

    return View;
});
